import {Axios} from "@/services/axios.js"

export default{
     RegisterUser(data){
        try {
            Axios.post('users',data)
        } catch (error) {
            return error
        }
    },

     LoginUser(data){
        try {
             Axios.post('auth/login',data)
            .then(reponse => {
                return reponse.data
            })
        } catch (error) {
            return error
        }
    }
}
